SELECT * FROM dual

mapper.delete:
delete from HEALTH_MEDICAL_EXAM_EVAL
where TENANTID_ =#{tenantId}

	and YEAR_ = #{year}


	and MONTH_ = #{month}

mapper.select:
select distinct E.*



		order by ${orderBy}


		order by E.ID_ desc

mapper.sql:
from HEALTH_MEDICAL_EXAM_EVAL E


	1 = 1


		and E.BATCHID_ = #{batchId}



		and E.CHECKID_ = #{checkId}



		and E.JOBNO_ = #{jobNo}



		and E.TENANTID_ = #{tenantId}



		and E.TENANTID_ IN

			#{x_tenantId}




		and E.GRADEID_ = #{gradeId}



		and E.GRADEID_ IN

			#{x_gradeId}




		and E.PERSONID_ = #{personId}



		and E.PERSONID_ IN

			#{x_personId}




		and E.NAME_ like #{nameLike}



		and E.SEX_ = #{sex}



		and E.HEIGHT_ >= #{heightGreaterThanOrEqual}



		and E.HEIGHT_ <= #{heightLessThanOrEqual}



		and E.WEIGHT_ > E.STDWEIGHT_



		and E.WEIGHTLEVEL_ >= #{weightLevelGreaterThanOrEqual}



		and E.WEIGHT_ >= #{weightGreaterThanOrEqual}



		and E.WEIGHT_ <= #{weightLessThanOrEqual}



		and E.WEIGHTHEIGHTPERCENT_ >=
		#{weightHeightPercentGreaterThanOrEqual}



		and E.WEIGHTHEIGHTPERCENT_ <=
		#{weightHeightPercentLessThanOrEqual}



		and E.WEIGHTOFFSETPERCENT_ >=
		#{weightOffsetPercentGreaterThanOrEqual}



		and E.BMI_ >= #{bmiGreaterThanOrEqual}



		and E.BMI_ <= #{bmiLessThanOrEqual}



		and E.TYPE_ = #{type}



		and E.YEAR_ = #{year}



		and E.YEAR_ >= #{yearGreaterThanOrEqual}



		and E.YEAR_ <= #{yearLessThanOrEqual}



		and E.MONTH_ = #{month}



		and E.CREATETIME_ >= #{createTimeGreaterThanOrEqual}



		and E.CREATETIME_ <= #{createTimeLessThanOrEqual}
